function addLowestPriceProperty(hotels) {
  return hotels.map((hotel) => {
    let lowestPriceRoom = null;
    let lowestPrice = Infinity;

    // Loop through each price site to find the lowest price
    if (hotel.extraDetails?.prices?.sites) {
      hotel.extraDetails.prices.sites.forEach((site) => {
        site.siteRooms.forEach((room) => {
          let roomPrice = parseFloat(room.roomPrice.replace('$', ''));

          // Check if this is the lowest price
          if (roomPrice < lowestPrice) {
            lowestPrice = roomPrice;
            lowestPriceRoom = {
              siteTitle: site.siteTitle, // Added the booking site name
              price: roomPrice, // Now it's a number (without the $ sign)
              room: {
                roomTitle: room.roomTitle,
                roomProperties: room.roomProperties,
              },
            };
          }
        });
      });
    }

    // Add the lowest price object at the beginning of the hotel object
    return {
      lowestPrice: lowestPriceRoom,
      ...hotel,
    };
  });
}

function updateLowestPrices(data) {
  data.forEach((item) => {
    if (item.extraDetails?.prices?.sites) {
      let minPrice = Infinity;

      // Iterate over each site
      item.extraDetails.prices.sites.forEach((site) => {
        // Iterate over each room in the site
        site.siteRooms.forEach((room) => {
          if (room.roomPrice) {
            // Remove "$" and "," and parse the price to a number
            const price = parseFloat(
              room.roomPrice.replace('$', '').replace(',', '')
            );

            // Update the minimum price if a lower price is found
            if (!isNaN(price)) {
              minPrice = Math.min(minPrice, price);
            }
          }
        });
      });

      // Replace the lowestPrice.price with the minimum price
      if (minPrice !== Infinity) {
        item.lowestPrice.price = minPrice;
      }
    }
  });

  return data;
}

function extractItemsWithEmptyArrays(jsonArray) {
  // Helper function to recursively check for empty arrays in an object
  function findEmptyArrays(obj) {
    const result = {};

    for (const key in obj) {
      if (Array.isArray(obj[key]) && obj[key].length === 0) {
        result[key] = []; // Include keys with empty arrays
      } else if (typeof obj[key] === 'object' && obj[key] !== null) {
        // Recursively check nested objects
        const nestedResult = findEmptyArrays(obj[key]);
        if (Object.keys(nestedResult).length > 0) {
          result[key] = nestedResult; // Include non-empty nested results
        }
      }
    }

    return result;
  }

  // Filter the items and retain only properties with empty arrays
  return jsonArray
    .map((item) => {
      const filteredItem = findEmptyArrays(item);
      return Object.keys(filteredItem).length > 0 ? filteredItem : null;
    })
    .filter(Boolean); // Remove null values (items without empty arrays)
}

